import React from "react";
import { useParams } from "react-router-dom";
import Header from "../Components/Header";

const Details = () => {
  const { title } = useParams();

  return (
    <>
      <Header />
      <main>
        <div className="details">
          <h2>{title}</h2>
        </div>
      </main>
    </>
  );
};

export default Details;
